// static
bool UnionTraits<::viz::mojom::BundledFrameSubmissionData::DataView, ::viz::mojom::BundledFrameSubmissionDataPtr>::Read(
    ::viz::mojom::BundledFrameSubmissionData::DataView input, ::viz::mojom::BundledFrameSubmissionDataPtr* output)
{
    using UnionType = ::viz::mojom::BundledFrameSubmissionData;
    using Tag = UnionType::Tag;

    switch (input.tag()) {
    case Tag::kFrame: {
        ::viz::mojom::BundledCompositorFramePtr result_frame;
        if (!input.ReadFrame(&result_frame))
            return false;

        *output = UnionType::NewFrame(std::move(result_frame));
        break;
    }
    case Tag::kDidNotProduceFrame: {
        ::viz::BeginFrameAck result_did_not_produce_frame;
        if (!input.ReadDidNotProduceFrame(&result_did_not_produce_frame))
            return false;

        *output = UnionType::NewDidNotProduceFrame(std::move(result_did_not_produce_frame));
        break;
    }
    case Tag::kDidDeleteSharedBitmap: {
        ::viz::SharedBitmapId result_did_delete_shared_bitmap;
        if (!input.ReadDidDeleteSharedBitmap(&result_did_delete_shared_bitmap))
            return false;

        *output = UnionType::NewDidDeleteSharedBitmap(std::move(result_did_delete_shared_bitmap));
        break;
    }
    default:

        return false;
    }
    return true;
}

